import React, { useState } from "react";
import data from "./data.js";

console.log(data);

const getObjectsNames = () => {
  return data.map((obj) => {
    return obj.name;
  });
};
console.log(getObjectsNames);

const getYear = (date) => {
  let year = date.split("-");
  return year[2];
};

const getBornBefore = () => {
  return data.filter((obj) => {
    let year = getYear(obj.birthday);
    console.log(year);
    return year < 1990;
  });
};
// console.log(getBornBefore());

function Counter() {
  return <div className="main-box"></div>;
}
export default Counter;
